Hot and mean  Charley Chase and Lylith Lavey - Guess Who's Cumming For Dinner 


September 21st, 2010 


Charley and her ex-husband are still good friends, which doesn't sit well with his current girlfriend, Lylith. When all three have dinner together, Lylith can't stop imagining her boyfriend and his ex-wife making out. She becomes rude and ruins the evening. She later goes over to Charley's house to make sure she understands to stay away from her boyfriend. Charley gets taught a lesson she'll never forget.
